                var SFA = data[i][4];
                var bd = new Date(data[i][5]);
                var year = bd.getFullYear();
                var today = new Date();
                var thisyear = today.getFullYear();
                var AGE = thisyear-year;
                var VIEW_B = data[i][6];
                var VIEW_M = data[i][7];
                var VIEW_P = data[i][8];
                var S = data[i][10];
                var W = data[i][11];
                var WR = data[i][12];
                var CH = data[i][13];
                var PLAZA = data[i][14];
                var LUCKY = data[i][16];
                v = 0.293751+0.002017*SFA-0.000000372*SFA*SFA+0.008416*AGE+0.007578*floor-0.000106*floor*floor+0.006402*VIEW_B+
                0.030411*VIEW_M +0.007832*S-0.002411*W+0.118217*WR+0.041683*CH+0.103221*PLAZA+0.006632*LUCKY;
                truev = Math.pow(Math.E, v);
                document.getElementById('valuation').innerHTML = Math.round(truev*1000000);
                document.getElementById('valuation').style.color = "blue";
                document.getElementById('SFA').innerHTML = data[i][4];
                document.getElementById('SFA').style.color = "blue";
                document.getElementById('bdate').innerHTML = bd.getMonth()+1+"/"+bd.getFullYear();
                document.getElementById('bdate').style.color = "blue";
                found = true;
            }
        }
        if (found==false) {
            document.getElementById('valuation').innerHTML = "flat not found";
            document.getElementById('valuation').style.color = "red";
            document.getElementById('SFA').innerHTML = "flat not found";
            document.getElementById('SFA').style.color = "red";
            document.getElementById('bdate').innerHTML = "flat not found";
            document.getElementById('bdate').style.color = "red";
        }

    }

    var finner;
    for (let i = 1;i<40;i++) {
        finner += "<option value="+ i +">" + i + "</option>"
    }
    document.getElementById('floor').innerHTML = finner;

</script>
